import logo from "./logo.svg";
import "./App.css";

function App() {
  return (
    <div className="App">
      <ul>
        <li>Rome</li>
        <li>Paris</li>
        <li>Barcelona</li>
        <li>Lisbon</li>
      </ul>
    </div>
  );
}

export default App;
